import React, { useState, useMemo, useEffect } from 'react';
import './boq.css';
import { Slider, Skeleton, Tabs, Tab, Button, Dialog, DialogTitle, DialogContent, DialogActions } from '@mui/material';
import { ShoppingCart, Favorite, Compare } from '@mui/icons-material';
import { supabase } from './supabase';

const Card = ({ title, price, image, details, addOns, initialMinimized = false, roomData, onAddToCart, onAddToFavorites, onAddToCompare }) => {
  const [selectedAddOns, setSelectedAddOns] = useState({});
  const [isMinimized, setIsMinimized] = useState(initialMinimized);
  const basePrice = price;

  // ... (rest of the Card component remains the same)

  return (
    <div className="card-container">
      {/* ... (existing card content) */}
      <CardSection className="card-actions">
        <Button startIcon={<ShoppingCart />} onClick={() => onAddToCart({ title, price: calculateTotalPrice, addOns: selectedAddOns })}>
          Add to Cart
        </Button>
        <Button startIcon={<Favorite />} onClick={() => onAddToFavorites({ title, price: calculateTotalPrice })}>
          Favorite
        </Button>
        <Button startIcon={<Compare />} onClick={() => onAddToCompare({ title, price: calculateTotalPrice, details })}>
          Compare
        </Button>
      </CardSection>
    </div>
  );
};

const App = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [priceRange, setPriceRange] = useState([1000, 12000]);
  const [productsData, setProductData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [roomNumbers, setRoomNumbers] = useState([]);
  const [activeTab, setActiveTab] = useState(0);
  const [cart, setCart] = useState([]);
  const [favorites, setFavorites] = useState([]);
  const [compareList, setCompareList] = useState([]);
  const [isCartOpen, setIsCartOpen] = useState(false);
  const [sortOption, setSortOption] = useState('price');

  const categories = [
    'All',
    'Furniture', 
    'Civil / Plumbing', 
    'Lighting', 
    'Electrical', 
    'Partitions- door / windows / ceilings',
    'Paint', 
    'HVAC', 
    'Smart Solutions', 
    'Flooring', 
    'Accessories'
  ];

  // ... (existing fetchRoomData and fetchProductsData functions)

  useEffect(() => {
    Promise.all([fetchRoomData(), fetchProductsData()]);
  }, []);

  const handleSearch = (event) => {
    setSearchQuery(event.target.value.toLowerCase());
  };

  const handleSliderChange = (event, newValue) => {
    setPriceRange(newValue);
  };

  const handleAddToCart = (product) => {
    setCart([...cart, product]);
  };

  const handleAddToFavorites = (product) => {
    setFavorites([...favorites, product]);
  };

  const handleAddToCompare = (product) => {
    if (compareList.length < 3) {
      setCompareList([...compareList, product]);
    } else {
      alert("You can compare up to 3 products at a time.");
    }
  };

  const handleRemoveFromCart = (index) => {
    const newCart = [...cart];
    newCart.splice(index, 1);
    setCart(newCart);
  };

  const filteredProducts = useMemo(() => {
    let filtered = productsData.filter((product) => {
      const matchesSearch = product.title.toLowerCase().includes(searchQuery) ||
                            product.details.toLowerCase().includes(searchQuery);
      const matchesPrice = product.price >= priceRange[0] && product.price <= priceRange[1];
      const matchesCategory = categories[activeTab] === 'All' || product.category === categories[activeTab];
      return matchesSearch && matchesPrice && matchesCategory;
    });

    // Sort products
    switch (sortOption) {
      case 'price':
        filtered.sort((a, b) => a.price - b.price);
        break;
      case 'name':
        filtered.sort((a, b) => a.title.localeCompare(b.title));
        break;
      default:
        break;
    }

    return filtered;
  }, [productsData, searchQuery, priceRange, activeTab, sortOption]);

  return (
    <div className="App">
      <div className="search-filter">
        {loading ? (
          <>
            <Skeleton variant="rectangular" height={40} width="80%" className="skeleton-bar" />
            <Skeleton variant="rectangular" height={40} width="80%" className="skeleton-slider" />
          </>
        ) : (
          <>
            <input
              type="text"
              placeholder="Search products..."
              value={searchQuery}
              onChange={handleSearch}
              className="search-bar"
            />
            <Slider
              value={priceRange}
              onChange={handleSliderChange}
              valueLabelDisplay="auto"
              min={1000}
              max={12000}
              className="price-slider"
            />
            <select value={sortOption} onChange={(e) => setSortOption(e.target.value)}>
              <option value="price">Sort by Price</option>
              <option value="name">Sort by Name</option>
            </select>
          </>
        )}
      </div>

      <Tabs value={activeTab} onChange={(e, newValue) => setActiveTab(newValue)}>
        {categories.map((category, index) => (
          <Tab key={index} label={category} />
        ))}
      </Tabs>

      <div className="products-grid">
        {loading ? (
          Array.from({ length: 4 }).map((_, index) => (
            <div key={index} className="card-skeleton-container">
              <Skeleton variant="rectangular" height={150} width="100%" className="skeleton-card-image" />
              <Skeleton variant="text" width="60%" height={20} style={{ margin: '10px 0' }} />
              <Skeleton variant="text" width="80%" height={20} style={{ margin: '5px 0' }} />
              <Skeleton variant="text" width="50%" height={20} style={{ margin: '5px 0' }} />
            </div>
          ))
        ) : (
          filteredProducts.map((product) => (
            <Card
              key={product.id}
              title={product.title}
              price={product.price}
              details={product.details}
              addOns={product.addons}
              image={product.image}
              initialMinimized={product.initialMinimized}
              onAddToCart={handleAddToCart}
              onAddToFavorites={handleAddToFavorites}
              onAddToCompare={handleAddToCompare}
            />
          ))
        )}
      </div>

      <div className="floating-actions">
        <Button startIcon={<ShoppingCart />} onClick={() => setIsCartOpen(true)}>
          Cart ({cart.length})
        </Button>
        <Button startIcon={<Favorite />}>
          Favorites ({favorites.length})
        </Button>
        <Button startIcon={<Compare />}>
          Compare ({compareList.length})
        </Button>
      </div>

      <Dialog open={isCartOpen} onClose={() => setIsCartOpen(false)}>
        <DialogTitle>Shopping Cart</DialogTitle>
        <DialogContent>
          {cart.map((item, index) => (
            <div key={index}>
              <p>{item.title} - ₹{item.price}</p>
              <Button onClick={() => handleRemoveFromCart(index)}>Remove</Button>
            </div>
          ))}
        </DialogContent>
        <DialogActions>
          <Button onClick={() => setIsCartOpen(false)}>Close</Button>
          <Button color="primary">Checkout</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default App;
